import React from "react";
import ExpenseDate from "./ExpenseDate";

import './ExpenseForm.css';

const ExpenseForm =()=>{

    return(
        <div>
            <form>
                <div className="expense-form_wraper">
                    <div className="form_controls">
                        <label>Title</label>
                        <input type="text" className="fomr_input" />
                    </div>
                    <div className="form_controls">
                        <label>Amount</label>
                        <input type="number" min="0.01" step="0.01" className="fomr_input" />
                    </div>
                    <div className="form_controls">
                        <label>Date</label>
                        <input type="date" className="fomr_input" />
                    </div>
                </div>
            </form>
        </div>
    );

}

export default ExpenseForm;
